Рекомендуем обновить приложение до актуальной версии:
1. Открыть Play Market;
2. Перейти в раздел «Мои установленные приложения»;
3. Найти приложение «Социальный мониторинг»;
4. Нажать кнопку «Обновить»;
5. Перезагрузить мобильное устройство.
6. Повторно пройти регистрацию в приложении "СМ".
